ody>\r\n								<tr align="left" valign="top">\r\n									<td colspan="2" width="100%"><img alt="" height="30" src="/img/01.gif" width="1" /></td>\r\n								</tr>\r\n								<tr align="left" valign="bottom">\r\n									<td width="50%"><img height="48" src="/images/template1/logo.jpg" width="178" /></td>\r\n									<td align="right" width="50%">\r\n									<table cellpadding="10" cellspacing="0" width="*">\r\n										<tbody>\r\n											<tr align="center" valign="bottom">\r\n												<td width="*"><a href="/o_kompanii/section_o_Gydex.html" style="font-size:14px; font-weight:bold; color:black; text-decoration:none;">Продукт</a></td>\r\n												<td width="*"><a href="/solutions/" style="font-size:14px; font-weight:bold; color:black; text-decoration:none;">Услуги</a></td>\r\n												<td width="*"><a href="/contacts/" style="font-size:14px; font-weight:bold; color:black; text-decoration:none;">Контакты</a></td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						<!-- endof header --><!-- slogan -->\r\n\r\n						<table border="0" cellpadding="0" cellspacing="0" style="	background-color:#f15d22;\r\n	background-image:url(/images/template1/slogan-fon.jpg);\r\n	background-position:left bottom;\r\n	background-repeat:repeat-x;" width="100%">\r\n							<tbody>\r\n								<tr align="center" valign="middle">\r\n									<td style="\r\n	text-align:center;\r\n	color:white; \r\n	font-size:40px;\r\n	font-weight:bold;" width="*">Самое время зарабатывать!</td>\r\n									<td width="1"><img alt="" height="110" src="/img/01.gif" width="1" /></td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						<!-- endof slogan --><!-- body -->\r\n\r\n						<table border="0" cellpadding="35" cellspacing="0" style="background-color:white;\r\n	" width="100%">\r\n							<tbody>\r\n								<tr align="left" valign="top">\r\n									<td><!-- banner -->\r\n									<table border="0" cellpadding="10" cellspacing="0" style="background-color:#222629;        " width="100%">\r\n										<tbody>\r\n											<tr align="left" valign="top">\r\n												<td>\r\n												<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n													<tbody>\r\n														<tr align="left" valign="top">\r\n															<td width="430"><img height="308" src="/images/template1/ban1.jpg" width="430" /></td>\r\n															<td style="padding-left:10px; color:white;\r\n	font-size:16px;" width="*">&nbsp;\r\n															<div class="c14"><strong>Облачная CRM система</strong></div>\r\n															<br />\r\n															Центр управления Вашим<br />\r\n															бизнесом<br />\r\n															&nbsp;\r\n															<div class="c14"><strong>24 часа</strong> в сутки в любой<br />\r\n															точке мира, где есть<br />\r\n															<strong>Интернет</strong>!</div>\r\n															<br />\r\n															<br />\r\n															<a href="/test_access.php" style="background-image:url(/images/template1/button-fon.jpg);\r\n	background-position:bottom left; background-repeat:repeat-x;\r\n	color:white; text-transform:uppercase; font-size:12px;\r\n	height:25px;\r\n	padding-top:8px; padding-left:20px;\r\n	width:200px;\r\n	display:inline-block;\r\n	font-weight:bold;\r\n	text-align:left; text-decoration:none;">Протестировать сейчас</a></td>\r\n														</tr>\r\n													</tbody>\r\n												</table>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									<!-- endof banner --><br />\r\n									<!-- two col -->\r\n									<table align="center" border="0" cellpadding="0" cellspacing="0" width="100%">\r\n										<tbody>\r\n											<tr align="left" valign="top">\r\n												<td width="315"><img height="179" src="/images/template1/gydex_what.jpg" width="315" /><br />\r\n												<br />\r\n												Сервис представляет собой инструмент<br />\r\n												по управлению работой всех отделов<br />\r\n												компании. Для работы с системой не требуется установки программного обеспечения, а доступ к ней возможен с различных стационарных и мобильных устройств, из всех существующих браузеров.<br />\r\n												<br />\r\n												<a href="/o_kompanii/section_o_Gydex.html" style="background-image:url(/images/template1/button-fon.jpg);\r\n	background-position:bottom left; background-repeat:repeat-x;\r\n	color:white; text-transform:uppercase; font-size:12px;\r\n	height:25px;\r\n	padding-top:8px; padding-left:20px;\r\n	width:200px;\r\n	display:inline-block;\r\n	font-weight:bold;\r\n	text-align:left; text-decoration:none;">Читать далее</a></td>\r\n												<td width="*"><img alt="" height="110" src="/img/01.gif" width="60" /></td>\r\n												<td width="315"><img height="174" src="/images/template1/gydex_for.jpg" width="310" /><br />\r\n												<br />\r\n												Основные цели GYDEX: оптимизировать<br />\r\n												процессы коммерческой деятельности,<br />\r\n												усовершенствовать уровень<br />\r\n												результативности и удобства работы<br />\r\n												сотрудников, сократить ручной труд и<br />\r\n												увеличить степень автоматизации<br />\r\n												предприятия в целом...<br />\r\n												<br />\r\n												<a href="/o_kompanii/section_o_Gydex.html" style="background-image:url(/images/template1/button-fon.jpg);\r\n	background-position:bottom left; background-repeat:repeat-x;\r\n	color:white; text-transform:uppercase; font-size:12px;\r\n	height:25px;\r\n	padding-top:8px; padding-left:20px;\r\n	width:200px;\r\n	display:inline-block;\r\n	font-weight:bold;\r\n	text-align:left; text-decoration:none;">Читать далее</a></td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									<!-- endof two col --><br />\r\n									<!-- security -->\r\n									<div style="background-color:#579fd2;"><img height="223" src="/images/template1/secure.jpg" width="717" /></div>\r\n								