(6, 'Аэротек выставка', '<style type="text/css">html, body{\r\n	background-color:#fbf8e7;\r\n	font-family: Verdana, Tahoma, Arial, sans-serif;\r\n	font-size:14px;\r\n		margin: 0px 0px 0px 0px; \r\n	padding: 0px 0px 0px 0px; \r\n}\r\na{\r\n	text-decoration:none;\r\n	color:black;\r\n}\r\n</style>\r\n<table border="0" cellpadding="0" cellspacing="0" style="background-color:#fbf8e7;" width="100%">\r\n	<tbody>\r\n		<tr align="center" valign="top">\r\n			<td width="100%">\r\n			<table border="0" cellpadding="0" cellspacing="0" width="800">\r\n				<tbody>\r\n					<tr align="center" style="padding: 0 0; margin:0 0; height:178px !important;" valign="bottom">\r\n						<td width="800"><img alt="" height="178" src="/images/template3/up.jpg" width="800" /></td>\r\n					</tr>\r\n					<tr align="center" style="padding: 0 0; margin:0 0; height:293px !important;" valign="top">\r\n						<td width="800"><img alt="" height="293" src="/images/template3/h.jpg" width="800" /></td>\r\n					</tr>\r\n					<tr align="center" valign="top">\r\n						<td width="800">\r\n						<table border="0" cellpadding="0" cellspacing="0" width="480">\r\n							<tbody>\r\n								<tr align="left" valign="top">\r\n									<td width="480">&nbsp;\r\n									<div style="text-align:justify;"><strong>Компания Aerotech приглашает Вас с 25 по 29 мая 2015 года посетить 16-ю международную специализированную выставку &quot;Оборудование, приборы и инструменты для металлобрабатывающей промышленности&quot;. </strong></div>\r\n									<br />\r\n									<br />\r\n									Aerotech представит новинки оборудования:\r\n									<ul type="disc">\r\n										<li>5-осевые портальные обрабатывающие центры JOBS,<br />\r\n										3-х и 4-х осевые фрезерные и токарные станки SMTCL;</li>\r\n										<li>оборудование для глубокого сверления НТТ;</li>\r\n										<li>бесцентровое шлифование Henfux;</li>\r\n										<li>измерительное оборудование Prodim;</li>\r\n										<li>электроэрозионное оборудование HSPK.</li>\r\n									</ul>\r\n									<br />\r\n									<br />\r\n									<strong>Мы будем рады видеть Вас:</strong><br />\r\n									ЦВК &quot;Экспоцентр&quot;, павильон 7, зал 2, стенд 72D40<br />\r\n									тел. +7(495) 411-83-82, <a href="mailto:info@aerotechgroup.ru">info@aerotechgroup.ru</a><br />\r\n									&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr align="center" valign="top">\r\n						<td width="800"><a href="http://www.aerotechgroup.ru"><img alt="" height="156" src="/images/template3/down.jpg" width="800" /></a></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1429616633, 1429616777),
(7, 'Аэротек приглашение на выставку 2', '<style type="text/css">html, body{\n	background-color:#fbf8e7;\n	font-family: Verdana, Tahoma, Arial, sans-serif;\n	font-size:14px;\n		margin: 0px 0px 0px 0px; \n	padding: 0px 0px 0px 0px; \n}\na{\n	text-decoration:none;\n	color:black;\n}\n</style>\n<table border="0" cellpadding="0" cellspacing="0" style="background-color:#fbf8e7;" width="100%">\n	<tbody>\n		<tr align="center" valign="top">\n			<td width="100%">\n			<table border="0" cellpadding="0" cellspacing="0" width="800">\n				<tbody>\n					<tr align="center" style="padding: 0 0; margin:0 0; height:178px !important;" valign="bottom">\n						<td width="800"><img alt="" height="178" src="/images/template3/up.jpg" width="800" /></td>\n					</tr>\n					<tr align="center" style="padding: 0 0; margin:0 0; height:293px !important;" valign="top">\n						<td width="800"><img alt="" height="291" src="../../../images/template4/02.jpg" width="800" /></td>\n					</tr>\n					<tr align="center" valign="top">\n						<td width="800">\n						<table border="0" cellpadding="0" cellspacing="0" width="480">\n							<tbody>\n								<tr align="left" valign="top">\n									<td width="480">&nbsp;\n									<div style="text-align:justify;"><strong>Aerotech</strong> &ndash; лидер рынка - проектный интегратор технического перевооружения на территории России и стран СНГ. Aerotech занимается продажей про-мышленного оборудования, оснастки, инструмента, запасных частей, оказанием строительных услуг полного цикла.</div>\n									<br />\n									<br />\n									Узнайте больше об оборудовании:\n									<ul type="disc">\n										<li>5-осевые портальные обрабатывающие центры JOBS;</li>\n										<li>3-х и 4-х осевые фрезерные и токарные станки SMTCL;</li>\n										<li>оборудование для глубокого сверления HTT;</li>\n										<li>бесцентровое шлифование Henfux;</li>\n										<li>электроэрозионное оборудование HSPK.</li>\n									</ul>\n									<br />\n									&nbsp;</td>\n								</tr>\n							</tbody>\n						</table>\n						</td>\n					</tr>\n					<tr align="center" valign="top">\n						<td style=" background-color:#e95522;" width="800">\n						<table border="0" cellpadding="0" cellspacing="0" width="800">\n							<tbody>\n								<tr align="left" valign="top">\n									<td width="250"><img alt="" border="0" height="180" src="/images/template4/04.jpg" width="188" /></td>\n									<td valign="middle">\n									<div style="color:white;"><strong>Мы будем рады видеть Вас:</strong><br />\n									ЦВК &laquo;Экспоцентр&raquo;, Павильон 7, зал 2<br />\n									Стенд 72D40<br />\n									<br />\n									<a href="mailto:info@aerotechgroup.ru" style="color:white; font-weight:bold;">info@aerotechgroup.ru</a><br />\n									<a href="http://www.aerotechgroup.ru" style="color:white; font-weight:bold;">www.aerotechgroup.ru</a></div>\n									</td>\n									<td align="right" width="250"><img alt="" height="180" src="/images/template4/05.jpg" width="222" /></td>\n								</tr>\n							</tbody>\n						</table>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>', 1430122425, 1430122436),
