INSERT INTO `faq_question` (`id`, `question`, `answer`, `ord`, `is_shown`, `group_id`, `solution_id`) VALUES
(8, '<p>\r\n	Не могу войти в программу, получаю сообщение о неверном логине или пароле. Как быть?</p>', '<p>\r\n	Проверьте правильность раскладки клавиатуры и включение или выключения режима CapsLock при наборе пароля.</p>\r\n<p>\r\n	Если все правильно, а доступ не происходит &ndash; попробуйте воспользоваться формой восстановления пароля.</p>\r\n<p>\r\n	Для этого нажмите кнопку &laquo;Войти&raquo; в шапке сайта, и перейдите по ссылке &laquo;Восстановить доступ&raquo; в открывшемся окне. Вам будет предложено ввести Ваш логин, и при наличии такого пользователя в системе <span class="gydex">CRM GYDEX</span> будет дана возможность задать новый пароль. Следуйте инструкциям системы.</p>\r\n<p>\r\n	Если эти меры не помогли &ndash; просьба связаться с менеджером <span class="gydex">CRM GYDEX</span>, ведущим Ваш договор.</p>', 1, 1, 0, 0),
(7, '<p>\r\n	Я забыл свой логин. Что мне делать?</p>', '<p>\r\n	Логин &ndash; это адрес электронной почты, с которым Вы были зарегистрированы в системе. Если Вы не помните его, то в этом случае Вам необходимо связаться с менеджером <span class="gydex">CRM GYDEX</span>, ведущим Ваш договор. Ваш доступ будет восстановлен.</p>', 1, 1, 0, 0),
(6, '<p>\r\n	Я забыл свой пароль. Что мне делать?</p>', '<p>\r\n	Воспользуйтесь формой восстановления пароля <span class="gydex"> CRM GYDEX</span>. Для этого нажмите кнопку &laquo;Войти&raquo; в шапке сайта, и перейдите по ссылке &laquo;Восстановить доступ&raquo; в открывшемся окне. Вам будет предложено ввести Ваш логин, и при наличии такого пользователя в системе <span class="gydex"> CRM GYDEX</span> будет дана возможность задать новый пароль. Следуйте инструкциям системы.</p>', 1, 1, 0, 0),
(9, '<p>\r\n	У меня есть доступ в программы по нескольким компаниям. Как мне переключиться между ними?</p>', '<p>\r\n	При условии, что реквизиты доступа в программы <span class="gydex">CRM GYDEX</span> по всем компаниям совпадают, при входе в систему GYDEX Вам будет предложено выбрать одну из компаний. Кроме того, в меню программы каждой доступной компании будет доступен пункт &laquo;выбрать другую базу&raquo; (значок <img alt="" src="/img/outer/images/ico_select.jpg" style="width: 32px; height: 32px;" />), который позволит это сделать.</p>', 1, 1, 0, 0),
(10, '<p>\r\n	Нам нужен определенный отчет по данным программы, которого нет в предложенном нам решении. Как получить этот отчет?</p>', '<p>\r\n	Вам необходимо связаться с менеджером <span class="gydex">CRM GYDEX</span>, ведущим Ваш договор, для уточнения всех деталей нового отчета и сроков и условий доработки программы. После чего наши программисты реализуют необходимый Вам отчет.</p>', 1, 1, 0, 0),
(11, '<p>\r\n	Нам необходимо добавить в <span class="gydex">СRM GYDEX</span> новый вид документа. Что для этого необходимо?</p>', '<p>\r\n	Вам необходимо связаться с менеджером <span class="gydex">CRM GYDEX</span>, ведущим Ваш договор, для уточнения всех деталей нового вида документов и сроков и условий доработки программы. После чего наши программисты реализуют необходимые Вам документы.</p>', 1, 1, 0, 0),
(12, '<p>\r\n	У нас несколько связанных между собой компаний. Существует ли единое решение <span class="gydex">CRM GYDEX</span> для автоматизации работы всех этих компаний?</p>', '<p>\r\n	Все решения <span class="gydex">CRM GYDEX</span> позволяют работать со многими организациями внутри одного решения. Просим Вас связаться с Вашим менеджером <span class="gydex">CRM GYDEX</span> для уточнения условий развертывания нескольких связанных организаций внутри Вашего решения <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 0),
(13, '<p>\r\n	Поддерживается ли в <span class="gydex">CRM GYDEX</span> хранение файлов?</p>', '<p>\r\n	Хранение файлов поддерживается в любом продукте линейки <span class="gydex">CRM GYDEX</span>, как в отдельных файловых разделах с возможностью разграничения доступа к папкам, так и в связанных с каждым документом программы файловых хранилищах.</p>', 1, 1, 0, 0),
(14, '<p>\r\n	Существует ли разграничение доступа к файлам и документам в системах <span class="gydex">CRM GYDEX</span>?</p>', '<p>\r\n	Разграничение доступа к файлам и документам существует во всех программных решения <span class="gydex">CRM GYDEX</span>. Файловые разделы <span class="gydex">CRM GYDEX</span> позволяют разграничивать доступ к папкам и файлам на уровне пользователей и их групп. Доступ к документам регулируется бизнес-логикой определенного решения <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 0),
(15, '<p>\r\n	За счет чего в <span class="gydex">CRM GYDEX</span> удобно работать?</p>', '<p>\r\n	При разработке бизнес-логики <span class="gydex"> CRM GYDEX</span> учитываются реальные бизнес-процессы в компании-заказчике, его персонала, особенности работы, а при проектировании интерфейса используются многолетние наработки нашей компании, а также анализ пользовательской активности социальных сетей. Таким образом, сотрудник начинает работать в <span class="gydex"> CRM GYDEX</span> на &laquo;подсознательном&raquo;, &laquo;интуитивном&raquo; уровне. Вы всегда можете ощутить это на себе, заказав тестовый доступ в <span class="gydex"> CRM GYDEX</span>.</p>', 1, 1, 0, 0),
(16, '<p>\r\n	Возможно ли внесение изменений в алгоритмы работы <span class="gydex">CRM GYDEX</span>?</p>', '<p>\r\n	Безусловно!</p>\r\n<p>\r\n	Все Ваши пожелания по доработке программы будут приняты к рассмотрению и реализованы в кратчайшие сроки командой <span class="gydex">CRM GYDEX</span>!</p>', 1, 1, 0, 0),
(17, '<p>\r\n	Какова стоимость программного продукта линейки <span class="gydex">CRM GYDEX</span>?</p>', '<p>\r\n	Стоимость доступа к Вашему программному продукту <span class="gydex">СRM GYDEX</span> строго индивидуальна и рассчитывается нашим менеджером при получении от Вас технического задания. При этом Вы платите всего лишь ежемесячный платеж, в который уже включены бесплатные доработки Вашего программного продукта <span class="gydex">CRM GYDEX</span>,&nbsp; неограниченное число пользователей, бесплатные технические консультации наших специалистов, техническая поддержка 24 часа и многое другое.</p>', 1, 1, 0, 0),
(18, '<p>\r\n	Постоянна ли стоимость оплаты <span class="gydex">CRM GYDEX</span>?</p>', '<p>\r\n	<strong>В течение всего периода действия договора &ndash; постоянна</strong>, т.е. чем на большее количество месяцев Вы заключите Лицензионный договор, тем дольше Вы будете получать уникальный программный продукт по фиксированной цене, независимо от экономической ситуации в стране и рыночных колебаний. Более того, наша компания ставит перед собой цель постоянного повышения клиентской лояльности, поэтому даже после истечения срока действия договора ценообразование &ndash; лишь предмет переговоров. <strong>Для нас важен каждый клиент!</strong></p>', 1, 1, 0, 0),
(19, '<p>\r\n	Есть ли у Вас бюджетные предложения для малого бизнеса и индивидуальных предпринимателей?</p>', '<p>\r\n	Есть. Подробнее об этом Вам расскажет персональный менеджер, пожалуйста, напишите заявку посредством нашего сайта, <a href="/faq/?do_feedback">раздел &laquo;GYDEX.Знает&raquo;</a>.</p>', 1, 1, 0, 0),
(20, '<p>\r\n	Как происходит оплата программы <span class="gydex">CRM GYDEX</span>?</p>', '<p>\r\n	Условия работы с каждым клиентом индивидуальны. Стандартное условие &ndash; предоплата 100% за месяц вперед.</p>', 1, 1, 0, 0),
(21, '<p>\r\n	Чем <span class="gydex">CRM GYDEX</span> лучше конкурентов?</p>', '<p>\r\n	<strong>Мы предлагаем Вам программный продукт под ключ</strong>. Вам не нужно его дорабатывать, Вам не нужны сервера, у Вас нет затрат на оплату труда штатных программистов.<strong> Вы получаете 100% сервис под ключ за минимальную сумму в месяц</strong>. Сравните предложение <span class="gydex">CRM GYDEX</span> с предложением любого конкурента, и Вы сразу ощутите разницу, как финансовую, так и в качестве работы.</p>', 1, 1, 0, 0),
(22, '<p>\r\n	Могу ли я установить <span class="gydex">CRM GYDEX</span> себе на компьютер?</p>', '<p>\r\n	Этого не потребуется. Программа облачная, работает под любой современной операционной системой, с любым интернет - браузером. Единственное, что Вам необходимо &ndash; доступ в Интернет.</p>', 1, 1, 0, 0),
(23, '<p>\r\n	У меня смартфон Apple IPhone 6. Работает ли Ваша программа на нем?</p>', '<p>\r\n	Безусловно, работает. <span class="gydex">CRM GYDEX</span> адаптирована под любые современные &laquo;гаджеты&raquo; и операционные системы. По желанию заказчика, возможно создание мобильного приложения именно под Вашу версию <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 0),
(24, '<p>\r\n	Cуществует ли версия <span class="gydex">CRM GYDEX</span> для частных лиц и фрилансеров?</p>', '<p>\r\n	Да, существует. Специально для людей, работающих как &laquo;фрилансер&raquo; (фотографы, водители и пр.) мы разработали версию <span class="gydex">CRM GYDEX. For you!</span> Программа очень функциональна, наиболее полно соответствует пожеланиям заказчика, и недорога по своей стоимости.</p>', 1, 1, 0, 0),
(25, '<p>\r\n	Каков срок разработки программы &laquo;под ключ&raquo;?</p>', '<p>\r\n	Решения <span class="gydex">CRM GYDEX</span> разрабатываются и внедряются, в зависимости от сложности поставленных задач, в срок от 1 до 3 месяцев.</p>', 1, 1, 0, 0),
(26, '<p>\r\n	Я не могу составить техническое задание. Что мне делать?<span _fck_bookmark="1" id="cke_bm_195S" style="display: none;"> </span></p>', '<p>\r\n	Не переживайте. Консультант <span class="gydex">CRM GYDEX</span> сделает это за Вас. Потратьте небольшую часть своего драгоценного времени на помощь ему в изучении Ваших бизнес-процессов. Это самый сложный момент в работе с <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 0),
(27, '<p>\r\n	Потребуются ли мне дополнительные специалисты при создании и внедрении <span class="gydex">CRM GYDEX</span>?</p>', '<p>\r\n	Нет, все задачи выполняет команда <span class="gydex">СRM GYDEX</span>. Более того, после внедрения программы эффективность сотрудников значительно возрастет, что позволит оптимизировать штат, или возложить на персонал новые задачи.</p>', 1, 1, 0, 0),
(28, '<p>\r\n	Для автоматизации каких видов бизнеса предназначено решение <span class="gydex">CRM GYDEX Дилерский кабинет</span>?</p>', '<p>\r\n	<span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> позволяет автоматизировать работу с сетью дилеров, независимо от вида бизнеса. Программа настолько универсальна, что легко адаптируется специалистами <span class="gydex">CRM GYDEX</span> под абсолютно любые задачи. Функционал программы не ограничен базовым набором, Вы всегда можете бесплатно доработать программу <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> под свой вид бизнес. Подробнее о программном продукте Вы можете прочитать в соответствующем разделе нашего сайта.</p>', 1, 1, 0, 1),
(29, '<p>\r\n	Доступны ли отчеты о выполнении заказов дилеров?</p>', '<p>\r\n	В программе <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> доступна группа отчетов, позволяющих контролировать сроки и своевременность выполнения каждого этапа жизненного цикла заказа. Набор отчетов возможно дополнить абсолютно любыми настройками по желанию заказчика.</p>', 1, 1, 0, 1),
(30, '<p>\r\n	Возможно ли интегрирование программы с 1С?</p>', '<p>\r\n	Да, такая функция в <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> предусмотрена. Но мы предлагаем не спешить с интеграцией, поскольку 1С &ndash; сложная платформа, которая постоянно меняется. Вам, как заказчику, придется нести дополнительные затраты в связи с этим, в то время как доработки в <span class="gydex">CRM GYDEX</span> бесплатны в рамках базового пакета.</p>', 1, 1, 0, 1),
(31, '<p>\r\n	Существует ли в <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> автоматизация доставки заказа?</p>', '<p>\r\n	Для автоматизации доставки Вы можете воспользоваться электронной заявкой на доставку по заказу.</p>', 1, 1, 0, 1),
(32, '<p>\r\n	Реализована ли защита коммерческой информации в <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span>? Могут ли дилеры увидеть данные о заказах других дилеров?</p>', '<p>\r\n	Вся информация о заказах и документах каждого дилера полностью защищена. Другим дилерам в программе она недоступна. За счет базовых&nbsp; функций программы дилеры, работающие в программе, не видят других дилеров. По желанию заказчика, возможны любые разграничения прав доступа.</p>', 1, 1, 0, 1),
(33, '<p>\r\n	Доступна ли работа с претензиями и рекламациями в <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span>?</p>', '<p>\r\n	Работа с претензиями и рекламациями доступна по определенным заказам. Чтобы сформировать рекламацию по определенному заказу, нажмите кнопку &laquo;Создать рекламацию&raquo; в карте этого заказа или в его строке в списке заказов.</p>', 1, 1, 0, 1),
(34, '<p>\r\n	Как в <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> контролировать наличие оригиналов документов по заказам?</p>', '<p>\r\n	В каждом заказе реализована возможность отмечать галочками наличие необходимых оригиналов документов. Отчет &laquo;Оригиналы документов&raquo; позволяет узнать, по каким заказам нет каких документов.</p>', 1, 1, 0, 1),
(35, '<p>\r\n	Контролируется ли в программе <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> своевременная отгрузка заказа дилеру?</p>', '<p>\r\n	Да, такая возможность реализована. Используйте отчет &laquo;Невывезенные заказы&raquo; для уточнения, какие заказы не были отгружены в срок. Отчет &laquo;Отгруженные заказы&raquo; позволяет узнать, какие заказы были отгружены в какие даты.</p>', 1, 1, 0, 1),
(36, '<p>\r\n	Как мне выяснить, какой сотрудник отвечает в программе <span class="gydex">&laquo;СRM GYDEX</span>. Дилерский кабинет&raquo; за какой вопрос?</p>', '<p>\r\n	Для этого используйте отчет &laquo;Вопросы, курируемые сотрудником&raquo; в разделе Сотрудники. Отметьте интересующие Вас вопросы, нажмите кнопку &laquo;Найти&raquo; и Вы получите информацию о сотрудниках, которые отвечают за выбранные вопросы.</p>\r\n<p>\r\n	Чтобы узнать, какие вопросы курирует определенный сотрудник &ndash; откройте его карту, в ней указана эта информация.</p>\r\n<p>\r\n	Данная функция является базовой для всех программных продуктов линейки <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 1),
(37, '<p>\r\n	Доступна ли работа с несколькими торговыми точками одного дилера в&nbsp; <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span>?</p>', '<p>\r\n	Такая возможность предусмотрена программой. Для этого в карте дилера необходимо указать несколько фактических адресов торговых точек. Дилер сможет авторизоваться в программе отдельно под записью каждой из этих торговых точек.</p>', 1, 1, 0, 1),
(38, '<p>\r\n	Для автоматизации каких видов бизнеса предназначено решение <span class="gydex">CRM GYDEX Электронное снабжение</span>?</p>', '<p>\r\n	<span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span> позволяет автоматизировать работу с поставками материалов, расходами ТМЦ, продажей товаров и услуг, независимо от вида бизнеса. Программа настолько универсальна, что легко адаптируется специалистами <span class="gydex">CRM GYDEX</span> под абсолютно любые задачи. Функционал программы не ограничен базовым набором, Вы всегда можете бесплатно доработать программу <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span> под свой вид бизнес. Подробнее о программном продукте Вы можете прочитать в соответствующем разделе нашего сайта.</p>', 1, 1, 0, 2),
(39, '<p>\r\n	Какие виды печатных форм документов доступны в программе <span class="gydex">CRM GYDEX Электронное снабжение</span>?</p>', '<p>\r\n	Товарная накладная, счет/фактура, акт о выполнении работ, доверенность, акт сверки, акт списания. В целом, в программе <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span> реализован постоянно обновляемый полный набор бухгалтерских и управленческих документов в рамках действующего Налогового Законодательства РФ.</p>', 1, 1, 0, 2),
(40, '<p>\r\n	Есть ли возможность закрытия отчетных периодов в <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Дат, эта возможность реализована. При наличии у Вас прав на это действие Вы можете открывать и закрывать отчетные периоды в разделе &laquo;Отчетные периоды&raquo; внутри раздела &laquo;Мои организации&raquo;.</p>', 1, 1, 0, 2),
(41, '<p>\r\n	Существует ли ограничение на количество документов в программе <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Ограничений на количество документов не предусмотрено. Вы можете создавать в программе любое необходимое число документов. Наши специалисты бесплатно доработают Ваш программный продукт линейки <span class="gydex">CRM GYDEX</span> под Ваши задачи.</p>', 1, 1, 0, 2),
(42, '<p>\r\n	Доступны ли инструменты по межскладским перемещениям в <span class="gydex">&laquo;СRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Для проведения межскладского перемещения товара используется модуль &laquo;Межсклад&raquo;.</p>', 1, 1, 0, 2),
(43, '<p>\r\n	Контролируются ли приходы и расходы ТМЦ в <span class="gydex">&laquo;СRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Да, количества контролируются! Любой продукт <span class="gydex">CRM GYDEX</span> в первую очередь соответствует нормам бухгалтерского учета, принятого в РФ или другой стране СНГ. Наши специалисты настоять выбранный Вами программный продукт под Ваши цели и задачи в строгом соответствии с действующим Законодательством Вашей страны.</p>', 1, 1, 0, 2),
(44, '<p>\r\n	Как мне получить информацию о том, сколько товара завезено по определенной заявке в программе <span class="gydex">&laquo;СRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Вы можете узнать об этом непосредственно в карте заявки: каждая цифра в таблице статистики представляет собой активную ссылку на перечень соответствующих документов. Кроме того, для этого удобно воспользоваться отчетами &laquo;Выполнение заявок&raquo;.</p>', 1, 1, 0, 2),
(45, '<p>\r\n	Как получить информацию о взаиморасчетах с поставщиком в <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Используйте для этого отчет &laquo;Ведомость по контрагенту&raquo;. Средства отчета позволяют получить как краткую, так и подробную информацию о взаиморасчетах с детализацией до документа.</p>', 1, 1, 0, 2),
(46, '<p>\r\n	Для кого в первую очередь предназначена программа <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span>?</p>', '<p>\r\n	Для компаний с большими приходами и расходами ТМЦ &ndash; строительные и инжиниринговые компании, торговые холдинги, сервисные компании и многие другие. Программный продукт универсален, специалисты <span class="gydex">CRM GYDEX</span> доработают его под Ваши технические задания абсолютно бесплатно и в кратчайшие сроки. Мы рекомендуем ознакомится со всей линейкой предложений и возможностей <span class="gydex">CRM GYDEX</span>&nbsp;<a href="/produkty/" target="_blank">в разделе &laquo;CRM GYDEX&raquo;</a> нашего сайта.</p>', 1, 1, 0, 2),
(47, '<p>\r\n	Для автоматизации каких видов бизнеса предназначено решение <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span>?</p>', '<p>\r\n	<span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> предназначена для торговых и производственных компаний, имеющих сложную номенклатуру. Идеально подходит для автоматизации всех участков компании &ndash; производства, склада, транспорта, офиса. Имеет очень широкий функционал в бухгалтерской части. Подробнее о программном продукте Вы можете прочитать в соответствующем разделе нашего сайта.</p>', 1, 1, 0, 3),
(48, '<p>\r\n	Есть ли возможность обеспечить доступ группам менеджеров к определенным прайс-листам?</p>', '<p>\r\n	Да, программа <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> позволяет это сделать.</p>\r\n<p>\r\n	Для разграничения прав доступа, либо предоставления Вам прав на разграничение доступа обратитесь к Вашему менеджеру <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 3),
(49, '<p>\r\n	Поддерживается ли возможность контролировать план продаж по менеджерам и отделам?</p>', '<p>\r\n	Такая возможность полностью реализована в <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span>. Раздел программы &laquo;План/факт продаж&raquo; позволяет заносить эти сведения по всем участвующим в продажах отделам и сотрудникам, а отчет &laquo;План/факт продаж&raquo; позволяет уточнять фактические объемы продаж определенной продукции, определенным контрагентам, определенными сотрудниками и т.п. Приятным бонусом для Вас окажется функция пересчета показателей в евро и доллары США по курсу ЦБ на день пересчета.</p>', 1, 1, 0, 3),
(50, '<p>\r\n	Есть ли поддержка работы со многими валютами в <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span>?</p>', '<p>\r\n	Да, программа <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> позволяет работать со многими валютами. Программа автоматически обновляет курсы валют по данным ЦБ РФ и ведет статистику изменения курсов валют. Возможны дополнительные надстройки по желанию Заказчика.</p>', 1, 1, 0, 3),
(51, '<p>\r\n	Контролируется ли рентабельность сделок в программе <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span>?</p>', '<p >\r\n	Да, по каждой сделке доступны как краткие, так и развернутые сведения о рентабельности. Алгоритм расчета, при этом, индивидуален и предоставляется Заказчиком. Обратитесь к Вашему менеджеру <span class="gydex">CRM GYDEX</span> для получения более полной информации.</p>', 1, 1, 0, 3),
(52, '<p>\r\n	Фиксируются ли изменения в определенном прайс-листе? Как мне узнать о них?</p>', '<p>\r\n	Все изменения в прайс-листах <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> фиксируются в журналах событий программы. Если Вы &ndash; менеджер по продажам определенной продукции, то при изменении цен прайс-листа вы получаете автоматическую рассылку об этом.</p>\r\n<p>\r\n	Кроме того, доступен отчет &laquo;Изменения в прайс-листе&raquo;. Он позволяет отследить все изменения по заданному товару, либо группе товаров.</p>', 1, 1, 0, 3),
(53, '<p>\r\n	Как мне получить печатную форму коммерческого предложения (счета, договора) в <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span>?</p>', '<p>\r\n	Воспользуйтесь кнопкой &laquo;Принтер&raquo; в карте нужного документа, либо в соответствующей ему строке списка выбранного документа.</p>\r\n<p>\r\n	Кроме того, вы можете отправить сразу клиенту на электронную почту pdf-версию выбранного документа, при этом, все контакты хранятся в карте контрагента. Программа также позволяет отслеживать, кто именно из пользователей получил данный документ на электронную почту или распечатал его.</p>', 1, 1, 0, 3),
(54, '<p>\r\n	Я хочу разослать коммерческие предложения нескольким контрагентам. Как мне это сделать?</p>', '<p>\r\n	В <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> данная функция реализована в карте документа. Для получения более подробной информации воспользуйтесь справочным разделом, обозначенным значком <img alt="" src="/img/outer/images/help24.jpg" style="width: 24px; height: 24px;" />.</p>\r\n<p>\r\n	Отметим, что конструктор шаблонов позволяет Вам создавать и отправлять любые документы в формате *pdf как в подписанном, так и в обычном виде. Наложение печати и подписей на документ производится в строгом соответствии с логикой, заданной Заказчиком.</p>', 1, 1, 0, 3),
(55, '<p>\r\n	Есть ли возможность в <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> предоставить доступ ко всем сделкам определенным сотрудникам?</p>', '<p  >\r\n	Да, такая возможность предусмотрена программой.</p>\r\n<p  >\r\n	Для согласования и выставления таких прав Вам необходимо обратиться к Вашему менеджеру <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 3),
(56, '<p>\r\n	Наши бизнес процессы несколько изменились. Возможно ли доработать нашу версию <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span>? Изменится ли цена?</p>', '<p  >\r\n	Конечно, возможно. Доработки совершенно бесплатны. Стоимость не меняется, если не меняется логика формирования алгоритмов программы, или она меняется незначительно. Если все-таки поставлена серьезная задача, стоимость ежемесячного обслуживания возрастает на 5-15%.&nbsp; Для получения подробной информации Вам необходимо обратиться к Вашему менеджеру <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 3),
(57, '<p>\r\n	&nbsp;Для кого предназначено решение <span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span>?</p>', '<p>\r\n	Данный программный продукт предназначен для автоматизации коммерческой деятельности физических лиц с небольшим бюджетом. Среди них &ndash; фотографы, преподаватели, водители, т.е. все те, кто занимается &laquo;работой на себя&raquo;, и кому необходим учет и контроль их коммерческой деятельности. Для получения подробной информации Вам необходимо обратиться к Вашему персональному менеджеру <span class="gydex">CRM GYDEX.</span></p>', 1, 1, 0, 5),
(58, '<p>\r\n	Можно ли внести изменения в программу <span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span>?</p>', '<p >\r\n	Да, это возможно. С Вас &ndash; техническое задание, с нас &ndash; его реализация!</p>', 1, 1, 0, 5),
(59, '<p>\r\n	Что входит в базовый пакет <span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span>?</p>', '<p>\r\n	Набор модулей разнообразен &ndash; ведение взаиморасчетов с контрагентами, контроль оплат, подготовка бухгалтерских и управленческих документов, ведение проектов, личный планировщик, модуль е-мэйл рассылок.</p>', 1, 1, 0, 5),
(60, '<p>\r\n	Сколько стоит программа <span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span>?</p>', '<p>\r\n	Для получения стоимости Вам нужно <a href="/register.php" target="_blank">оформить заявку на CRM GYDEX </a>на нашем сайте.</p>', 1, 1, 0, 5),
(61, '<p>\r\n	Подходит ли версия <span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span> для юридических лиц?</p>', '<p>\r\n	К сожалению, нет. Для подбора наиболее оптимального варианта <span class="gydex">CRM GYDEX</span> для Вас мы рекомендуем ознакомиться с разделом <span class="gydex">&laquo;CRM GYDEX&raquo;</span> нашего сайта, или заполнить соответствующую заявку.</p>', 1, 1, 0, 5),
(62, '<p>\r\n	Для кого предназначено решение <span class="gydex">&laquo;CRM GYDEX. Маркетинг и аналитика&raquo;?</p>', '<p>\r\n	Универсальное решение <span class="gydex">&laquo;CRM GYDEX. Маркетинг и аналитика&raquo;</span> предназначено для оптимизации маркетинговых и рекламных департаментов. Интегрируется с любым программным продуктом линейки <span class="gydex">CRM GYDEX</span>. Позволяет контролировать бюджет, отслеживать эффективность кампаний, наглядная статистика динамики раскрутки и управления вашим сайтом и многое другое. Для получения подробной информации Вам необходимо обратиться к Вашему персональному менеджеру <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 6),
(63, '<p>\r\n	Что входит в базовые набор программы <span class="gydex">&laquo;CRM GYDEX. Маркетинг и аналитика&raquo;</span>?</p>', '<p>\r\n	В базовый функционал программы <span class="gydex">&laquo;CRM GYDEX. Маркетинг и аналитика&raquo;</span> входят: смс рассылка; e-mail рассылка (конструктор шаблонов, аналитика); модуль &laquo;проведение мероприятий с клиентами&raquo; (бюджетирование, регистрация участников и пр.); система ведения контрагентов; контроль исполнения бюджетов и анализ финансовых результатов; модуль постановки и контроля исполнения индивидуальных задач, в том числе кросс-задач с другими подразделениями и сотрудниками. Более подробную информацию Вы можете получить в соответствующем разделе нашего сайта, либо у Вашего персонального менеджера <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 6),
(64, '<p>\r\n	Я уже использую индивидуальную программу <span class="gydex">CRM GYDEX</span>. Могу ли&nbsp; я дополнить ее модулем <span class="gydex">&laquo;CRM GYDEX. Маркетинг и аналитика&raquo;</span>?</p>', '<p>\r\n	Да, конечно. Наши специалисты проведут интеграцию в течение нескольких дней. Услуга интеграции бесплатна.</p>', 1, 1, 0, 6),
(65, '<p>\r\n	Какую аналитику и отчеты можно получать из <span class="gydex">&laquo;CRM GYDEX. Маркетинг и аналитика&raquo;</span>?</p>', '<p>\r\n	Это программа &ndash; конструктор, т.е. она позволяет анализировать в любом порядке все данные, которые в нее вносят пользователи. Так что все зависит от Ваших бизнес-процессов и Ваших сотрудников.</p>', 1, 1, 0, 6),
(66, '<p>\r\n	Для кого предназначено решение <span class="gydex">&laquo;CRM GYDEX. Проекты под ключ&raquo;</span>?</p>', '<p>\r\n	Для всех нас. Для наших самых требовательных клиентов, которым, по той или иной причине, не подходят готовые решения линейки <span class="gydex">CRM GYDEX</span>. Для нас не существует программных ограничений для реализации Ваших задач &ndash; вместе мы создадим такой программный продукт на базе <span class="gydex">CRM GYDEX</span>, который подходит Вам и Вашей компании на 100%?</p>', 1, 1, 0, 7),
(67, '<p>\r\n	Я готов разработать программу &laquo;Под ключ&raquo;. С чего начать?</p>', '<p >\r\n	Заполните анкету на разработку <span class="gydex">CRM GYDEX</span> на нашем сайте. С Вами свяжется наш консультант, который, проведя аудит Ваших бизнес-процессов, предложить оптимальное программное решение.</p>', 1, 1, 0, 7),
(68, '<p>\r\n	Какую программу я получу после внедрения?</p>', '<p >\r\n	Вы получите полностью адаптированную под Ваш бизнес версию <span class="gydex">&laquo;CRM GYDEX. Проекты под ключ&raquo;</span>. Вы даже сможете придумать ей красивое и понравившееся Вам название. Решение обладает уникальным набором функций, которые автоматизируют те бизнес-процессы Вашей компании, которые необходимы. Любые отчеты, печатные формы документов, аналитика. Все &ndash; только для Вас!</p>', 1, 1, 0, 7),
(69, '<p>\r\n	Есть ли какие-то ограничения при создании <span class="gydex">&laquo;CRM GYDEX. Проекты под ключ&raquo;</span>?</p>', '<p>\r\n	Ограничений на уровне логики программы нет. Все ограничения находятся в головах людей. Мы поможем Вам создать такой продукт, без которого Вы бы не мыслили дальнейшее развитие Вашего бизнеса.</p>', 1, 1, 0, 7),
(70, '<p>\r\n	Для автоматизации каких видов бизнеса предназначено решение <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>?</p>', '<p>\r\n	Решение <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> предназначено для обеспечения полной автоматизации &nbsp;торговых и производственных предприятий любых сфер деятельности.</p>', 1, 1, 0, 8),
(71, '<p>\r\n	Как мне узнать рентабельность сделки в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>?</p>', '<p>\r\n	При наличии у Вас таких прав Вам доступны отчеты &laquo;РЕ&raquo;, &laquo;Рентабельность бизнеса&raquo;, позволяющий получить подробные данные о рентабельности: по каждой реализованной товарной позиции, по каждой сделке, по рентабельности деятельности компании за выбранный период.</p>\r\n<p>\r\n	Кроме того, в карте заявки доступна кнопка &laquo;РЕ&raquo;, позволяющая получить развернутые данные о рентабельности по позициям заявки. Вам доступны ссылки на все документы по сделке.</p>', 1, 1, 0, 8),
(72, '<p>\r\n	Как узнать, были ли по определенной товарной позиции сделки, и какие именно?</p>', '<p>\r\n	Для этой цели в программе <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> реализован отчет &laquo;Поиск товара&raquo;. Введите фрагмент названия, или какую-либо иную характеристику товарной позиции, и Вы получите подробный отчет обо всех проведенных в программе документах и сделках по товарной позиции.</p>', 1, 1, 0, 8),
(73, '<p>\r\n	Осуществляется ли в программе контроль заполняемости данными документов?</p>', '<p>\r\n	Решение <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>, как и все другие решения <span class="gydex">CRM GYDEX</span>, обладает функциями проверки корректности заполнения любого документа при его утверждении. Проверяется заполняемость обязательных полей, а также корректность введенных данных.</p>\r\n<p>\r\n	Кроме того, предусмотрена группа отчетов &laquo;Заполняемость данными&raquo;, позволяющая контролировать заполнение как обязательных полей, так и тех полей документов, которые не были обязательными при утверждении документа.</p>', 1, 1, 0, 8),
(74, '<p>\r\n	Мне нужно выслать бухгалтерские документы по реализации товара контрагенту. Как это сделать?</p>', '<p>\r\n	В карте реализации доступен значок &laquo;@&raquo;. Кликните по этому значку, выберите виды документов для отправки, получателей из справочника контактов по контрагенту и сотрудникам, и нажмите кнопку &laquo;Отправить&raquo;.</p>\r\n<p>\r\n	Функция отправки печатных форм на электронную почту доступна для всех основных документов в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>.</p>', 1, 1, 0, 8),
(75, '<p>\r\n	Возможно ли показывать отдельным пользователям деятельность только по определенным контрагентам?</p>', '<p>\r\n	Да, такая возможность предусмотрена в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>. При наличии у Вас прав на эти действия в картах требуемых сотрудников доступна вкладка &laquo;Доступные контрагенты, сотрудники&raquo;. Разграничение доступа устанавливается в этой вкладке.</p>\r\n<p>\r\n	Если эта вкладка Вам не видна, просим обратиться к Вашему менеджеру CRM GYDEX для согласования и установки соответствующих прав.</p>', 1, 1, 0, 8),
(76, '<p>\r\n	Как мне оформить расходы на доставку по счету в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>?</p>', '<p>\r\n	Для этого в карте счета нажмите кнопку <img alt="" src="/img/outer/images/delivery.jpg" style="width: 32px; height: 20px;" />&nbsp;(&laquo;Создать внутреннюю доставку&raquo;).</p>\r\n<p>\r\n	При этом будет открыта форма создания расхода наличных по доставке. Заполните требуемые поля и утвердите документ.</p>', 1, 1, 0, 8),
(77, '<p>\r\n	Доступно ли включение товарных позиций из разных счетов в одну доверенность?</p>', '<p>\r\n	Да, такая функция реализована в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>. Для этого отметьте в карте доверенности галочку &laquo;позиции из других счетов указанного контрагента&raquo;, и нажмите кнопку &laquo;Редактировать позиции&raquo;. В списке позиций для выбора в доверенность появятся не занятые в других доверенностях позиции других счетов указанного контрагента.</p>', 1, 1, 0, 8),
(78, '<p>\r\n	Предусмотрен ли в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> ежедневный автоматический контроль выполнения бизнес-процессов?</p>', '<p>\r\n	Да, контроль выполнения бизнес-процессов предусмотрен:</p>\r\n<p>\r\n	Все действия пользователей во всех решениях <span class="gydex">CRM GYDEX</span> фиксируются в программном журнале событий.</p>\r\n<p>\r\n	На основе записей этого журнала реализованы автоматические рассылки сообщений о выполнении определенных задач определенными сотрудниками. Сотрудники получают напоминания о необходимости выполнения требуемых задач, руководители компании получают отчет о действиях сотрудников.</p>', 1, 1, 0, 8),
(79, '<p>\r\n	Реализована ли в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> возможность работы со многими банковскими реквизитами рабочей организации?</p>', '<p>\r\n	Эта возможность заложена во все решения <span class="gydex">CRM GYDEX</span>. Вы можете внести любое необходимое количество банковских реквизитов в карту организации и контрагента.</p>\r\n<p>\r\n	При формировании документов, использующих реквизиты, укажите те данные, которые требуются в этом документе!</p>\r\n<p>\r\n	Ряд отчетов в <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> позволяют получить данные о движении денежных средств как по всем, так и по выбранным реквизитам.</p>', 1, 1, 0, 8),
(80, '<p>\r\n	С помощью какого документа в решении <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> возможен учет расхода наличных, например, выдачи заработной платы?</p>', '<p>\r\n	Документ, предусмотренный для этого в программе, так и называется: &laquo;Расход наличных&raquo;. Работа с ним доступна в блоке &laquo;Оплаты&raquo;.</p>\r\n<p>\r\n	Затраты удобно разбиты по статьям из справочника программы.</p>\r\n<p>\r\n	Более подробно ознакомиться с работой с расходами наличных Вы можете из справочной системы <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span>, нажав значок&nbsp;<img alt="" src="/img/outer/images/help24.jpg" style="width: 24px; height: 24px;" />&nbsp; в карте или реестре расходов наличных.</p>', 1, 1, 0, 8),
(81, '<p>\r\n	Возможно ли с помощью программы <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> работать удаленно, на складах и дальних торговых точках?</p>', '<p>\r\n	Да, возможно. Причем, без каких-либо ограничений и дополнительных вложений. Вам потребуется компьютер (планшет) и доступ в Интернет. Для этой цели, собственно, подходят все программные решения линейки <span class="gydex">CRM GYDEX</span>.</p>', 1, 1, 0, 8),
(82, '<p>\r\n	Мне нужно организовать работу нескольких магазинов? Адаптировано ли решение <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> под данную задачу?</p>', '<p>\r\n	Конечно, многое зависит от Ваших индивидуальных бизнес-процессов. Но если взять классическую торговую компанию, то да, адаптировано. Напоминаем, что команда <span class="gydex">CRM GYDEX</span> бесплатно доработает Ваше программное решение под Ваши бизнес-процессы.</p>', 1, 1, 0, 8);
