INSERT INTO `otzyv` (`id`, `name`, `txt`, `is_on_site`, `ord`) VALUES
(1, '<p>\r\n	Генеральный директор ООО &quot;Новые технологии&quot;</p>', '<p>\r\n	За месяц работы программы удалось сократить издержки и повысить уровень продаж.<br />\r\n	Да, Gydex работает!</p>', 0, 1),
(4, '<p>\r\n	ЮТА. Генеральный директор, Кирилл Орлов</p>', '<p>\r\n	Основным вопросом было не только внедрение и упорядочивание системы продаж, но и защита информации. Все под контролем и надежной защитой, я это уже проверил. Работает.</p>', 0, 1),
(5, '<p>\r\n	Мосметрострой, Технический директор</p>', '<p>\r\n	Gydex заменяет секретаря,&nbsp; и &nbsp;программа все делает сама. Отчетность одним нажатием кнопки</p>', 0, 1),
(6, '<p>\r\n	Иванов Александр Васильевич, Генеральный директор ООО &laquo;СМУ-1 Метростроя&raquo;</p>', '<p>\r\n	Прекрасное и недорогое решение для нашего предприятия. Порадовала скорость внедрения, которую мы, кстати, практически не заметили. Команда&nbsp; CRM GYDEX молодцы!</p>', 1, 1),
(7, '<p>\r\n	Атмачева Татьяна Николаевна, Заместитель генерального директора по снабжению ООО &laquo;СМУ-1 Метростроя&raquo;</p>', '<p>\r\n	Идеологом внедрения CRM была я. С нашими оборотами возможностей стандартных систем было явно недостаточно. Ребята из GYDEX очень четко определили тот курс, по которому программа разрабатывалась и ставилась. За полгода мы имеем готовый работающий продукт и уже много лет им пользуемся.</p>', 1, 1),
(8, '<p>\r\n	Каллаев Омари Магадович<br />\r\n	Учредитель, Генеральный директор ЗАО &laquo;Форема-Кухни&raquo;</p>', '<p>\r\n	Проблема автоматизации мебельного производства была остра не одно поколение управленцев в нашей компании. Для себя мы выбрали решение &laquo;Дилерский кабинет&raquo; от CRM GYDEX, которое позволила нам в короткие сроки автоматизировать и упорядочить работу с дилерской сетью, повысить скорость обработки заказа, сделать бизнес с партнерами более прозрачным.</p>', 1, 1),
(9, '<p>\r\n	Юркова Оксана Вячеславовна,<br />\r\n	Директор по развитию дилерской сети ЗАО &laquo;Форема-Кухни&raquo;</p>', '<p>\r\n	Отличная программа. Надежная. Работает везде, где есть Интернет. Команда CRM GYDEX очень оперативно решают все возникающие у нас проблемы, коих, кстати, было немного. Радуют бесплатные доработки, которые &laquo;бонусом&raquo; идут к основному пакету &laquo;Дилерского кабинета&raquo;</p>', 1, 1),
(10, '<p>\r\n	Директор представительства БулТехКом<br />\r\n	Васил Коцев</p>', '<p>\r\n	100% болгарской компании с болгарским персоналом очень сложно было выходить на российский рынок. Ребят из GYDEX мы лично знаем с 2004 года, работая вместе над другим проектом. Когда через много лет судьба снова свела нас вместе, мы не пожалели ни на секунду, что остановили свой выбор на CRM GYDEX. Программа сделана исключительно под наши бизнес-процессы, что очень удобно и выгодно. Нельзя не сказать о минимальной на рынке стоимости за продукт такого уровня. Спасибо!</p>', 1, 1),
(11, '<p>\r\n	ООО &laquo;ЮТА&raquo;<br />\r\n	Генеральный директор<br />\r\n	Орлов Кирилл Константинович</p>', '<p>\r\n	Мы имели опыт работы с другими платформами в разное время развития компании. CRM GYDEX поразил меня своей простотой, емким функционалом, быстротой доработок и технической поддержкой, и, конечно, ценой. Мы в денежном эквиваленте ощутили на себе выгоды от использования данной системы.</p>', 1, 1),
(12, '<p>\r\n	ООО &quot;Сатурн&quot;<br />\r\n	Руководитель отдела продаж<br />\r\n	Калинина Екатерина Андреевна</p>', '<p>\r\n	CRM GYDEX не просто система контроля работы с клиентами. Для нас это программное обеспечение полного цикла, которое практически заменило нам и бухгалтерские программы, и офисные. Радует, что программа бесплатно совершенствуется вместе с нами.</p>', 1, 1);
