INSERT INTO `solution` (`id`, `parent_id`, `name`, `txt`, `task`, `otrasl`, `num_users`, `char_company`, `ability`, `ord`, `is_shown`) VALUES
(1, 9, 'СRM GYDEX. Дилерский кабинет', '<p><span itemprop="description">Универсальное решение <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> для&nbsp;автоматизации работы с дилерами, дистрибуторами и удаленными подразделениями. Интегрируется с любым программным продуктом линейки <span class="gydex">CRM GYDEX</span>. Позволяет полноценно управлять работой всех удаленных подразделений без потери в скорости и качестве работы персонала.</span></p>\r\n\r\n<p>В базовый функционал&nbsp; <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> включены следующие возможности:</p>\r\n\r\n<ul>\r\n	<li>обработка заказов, выписка счетов и отгрузочных документов;</li>\r\n	<li>система ведения контрагентов;</li>\r\n	<li>модуль постановки и контроля исполнения индивидуальных задач, в том числе кросс-задач с другими подразделениями и сотрудниками.</li>\r\n	<li>e-mail рассылка (конструктор шаблонов, аналитика);</li>\r\n	<li>контроль исполнения бюджетов и анализ финансовых результатов;</li>\r\n	<li>электронный документооборот (бухгалтерский, управленческий, финансовый);</li>\r\n	<li>файловое хранилище данных;</li>\r\n	<li>широкий набор отчетов для всех видов бизнесов;</li>\r\n	<li>электронная почта;</li>\r\n	<li>система обмена короткими сообщениями (&quot;аська&quot;).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Решение <span class="gydex">&laquo;CRM GYDEX. Дилерский кабинет&raquo;</span> прекрасно дорабатывается под задачи любого предприятия,</strong> имеющего филиальную сеть, или группу удаленных менеджеров. <strong>Все доработки традиционно бесплатны</strong> и включены в базовую стоимость использования программного продукта.</p>', '', '<br />', '', '<br />', '', 1, 1),
(2, 10, 'CRM GYDEX. Электронное снабжение', '<p><span itemprop="description">Программный продукт <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span> предназначен для автоматизации работы крупных строительных и производственных компаний с большим номенклатурным рядом, числом сотрудников и подразделений. Интегрируется с любым программным продуктом линейки <span class="gydex">CRM GYDEX</span>. Позволяет полноценно управлять работой всех департаментов компании: снабжения, технического отдела, производственными площадками, финансами, транспортом и многим другим.</span></p>\r\n\r\n<p>В базовый функционал <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span> включены следующие возможности:</p>\r\n\r\n<ul>\r\n	<li>контроль исполнения заявок на ТМЦ, расхода и перемещения материалов;</li>\r\n	<li>система ведения контрагентов;</li>\r\n	<li>модуль создания прайс-листов и координации работы персонала;</li>\r\n	<li>модуль постановки и контроля исполнения индивидуальных задач, в том числе кросс-задач с другими подразделениями и сотрудниками.</li>\r\n	<li>производственный блок (расход материалов, выход готовой продукции);</li>\r\n	<li>контроль исполнения бюджетов и анализ финансовых результатов;</li>\r\n	<li>электронный документооборот (бухгалтерский, управленческий, финансовый);</li>\r\n	<li>файловое хранилище данных;</li>\r\n	<li>широкий набор отчетов для всех видов бизнесов;</li>\r\n	<li>электронная почта</li>\r\n	<li>система обмена короткими сообщениями (&quot;аська&quot;)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Решение&nbsp;</strong> <span class="gydex">&laquo;CRM GYDEX. Электронное снабжение&raquo;</span><strong>&nbsp;прекрасно дорабатывается под задачи любого предприятия,</strong>&nbsp;имеющего собственное строительное или производственное подразделение.&nbsp;<strong>Все доработки традиционно бесплатны</strong>&nbsp;и включены в базовую стоимость использования программного продукта.</p>', '', '', '', '', '', 1, 1),
(3, 11, 'CRM GYDEX. Интеллектуальные продажи', '<p><span itemprop="description">Уникальное программное решение <span class="gydex">&laquo;CRM GYDEX. <span class="gydex">Интеллектуальные продажи</span>&raquo;</span> предназначено для&nbsp;автоматизации работы торговых и производственных компаний, индивидуальных предпринимателей с большим номенклатурным рядом, числом сотрудников и подразделений. Интегрируется с любым программным продуктом линейки <span class="gydex">CRM GYDEX</span>. Идеально подходит для автоматизации всех участков компании &ndash; производства, склада, транспорта, офиса. Имеет очень широкий функционал в бухгалтерской части.</span></p>\r\n\r\n<p>В базовый функционал <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span> включены следующие возможности:</p>\r\n\r\n<ul>\r\n	<li>коммерческий блок &laquo;под ключ&raquo; (счета, реализации, поступления, оплаты и пр.);</li>\r\n	<li>система ведения контрагентов;</li>\r\n	<li>модуль создания прайс-листов, в т.ч. сложных товарных групп на русском и английском языках;</li>\r\n	<li>постановка и контроль выполнения плана продаж;</li>\r\n	<li>автоматическая выписка коммерческих предложений, договоров, приложений, протоколов разногласий, заявлений, писем с онлайн отправкой выбранного документа нужному сотруднику или контрагенту, оптимизация продаж;</li>\r\n	<li>модуль постановки и контроля исполнения индивидуальных задач, в том числе кросс-задач с другими подразделениями и сотрудниками.</li>\r\n	<li>контроль исполнения бюджетов и анализ финансовых результатов;</li>\r\n	<li>электронный документооборот (бухгалтерский, управленческий, финансовый);</li>\r\n	<li>файловое хранилище данных;</li>\r\n	<li>широкий набор отчетов для всех видов бизнесов;</li>\r\n	<li>электронная почта;</li>\r\n	<li>система обмена короткими сообщениями (&quot;аська&quot;).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Решение&nbsp;</strong> <span class="gydex">&laquo;CRM GYDEX. Интеллектуальные продажи&raquo;</span><strong>&nbsp;прекрасно дорабатывается под задачи любого торгового или производственного предприятия, а также индивидуального предпринимателя</strong>. Программный продукт заменит Вам многие офисные и учетные программы, при несоизмеримо низкой стоимости работы.&nbsp;<strong>Все доработки традиционно бесплатны</strong>&nbsp;и включены в базовую стоимость использования программного продукта.</p>', '', '<br />', '', '<br />', '', 1, 1),
(5, 20, 'CRM GYDEX. FOR YOU!', '<p><span itemprop="description">Универсальная программа автоматизации <strong><span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span></strong> предназначена для автоматизации работы физических лиц с любой деятельностью и с самым разнообразным спектром задач. Интегрируется с любым программным продуктом линейки&nbsp;<strong><span class="gydex">CRM GYDEX</span></strong>. Идеально подходит для автоматизации работы людей, занимающихся бизнесом без образования юридического лица. Имеет очень широкий функционал в управлении проектами, учете деятельности, в бухгалтерской и финансовой части.</span></p>\r\n\r\n<p>В базовый функционал <strong><span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span></strong>&nbsp;включены следующие возможности:</p>\r\n\r\n<ul>\r\n	<li>коммерческий блок &laquo;под ключ&raquo; (счета, реализации, поступления, оплаты и пр.);</li>\r\n	<li>система ведения контрагентов;</li>\r\n	<li>автоматическая выписка любого современного бухгалтерского и финансового документа;</li>\r\n	<li>контроль взаиморасчетов;</li>\r\n	<li>модуль постановки и контроля исполнения индивидуальных задач;</li>\r\n	<li>файловое хранилище данных;</li>\r\n	<li>широкий набор отчетов для всех видов бизнесов;</li>\r\n	<li>электронная почта;</li>\r\n	<li>система обмена короткими сообщениями (&quot;аська&quot;).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Решение </strong> <strong><span class="gydex">&laquo;CRM GYDEX. FOR YOU!&raquo;</span></strong><strong>&nbsp;прекрасно дорабатывается под задачи любого физического лица, будь то фотограф, преподаватель или частный водитель. </strong>Программный продукт заменит Вам многие офисные и учетные программы, ручной учет, ускорит все Ваши бизнес-процессы, сохранит прибыль, при несоизмеримо низкой стоимости работы.&nbsp;<strong>Все доработки традиционно бесплатны</strong>&nbsp;и включены в базовую стоимость использования программного продукта.</p>', '', '', '', '', '', 1, 1),
(6, 21, 'CRM GYDEX. Маркетинг и аналитика', '<p><span itemprop="description">Универсальное решение <span class="gydex">CRM GYDEX. Маркетинг и аналитика</span> для <strong>оптимизации маркетинговых и рекламных департаментов</strong>. Интегрируется с любым программным продуктом линейки <span class="gydex">CRM GYDEX</span>. Позволяет контролировать бюджет, отслеживать эффективность кампаний, наглядная статистика динамики раскрутки и управления вашим сайтом<sup class="acro" data-comment="Оптимально работает с CMS GYDEX">*</sup>.</span></p>\r\n\r\n<p>В базовый функционал <span class="gydex">CRM GYDEX. Маркетинг и аналитика</span> включены следующие возможности:</p>\r\n\r\n<ul>\r\n	<li>смс рассылка;</li>\r\n	<li>e-mail рассылка (конструктор шаблонов, аналитика);</li>\r\n	<li>модуль &laquo;проведение мероприятий с клиентами&raquo; (бюджетирование, регистрация участников и пр.);</li>\r\n	<li>система ведения контрагентов;</li>\r\n	<li>контроль исполнения бюджетов и анализ финансовых результатов;</li>\r\n	<li>модуль постановки и контроля исполнения индивидуальных задач, в том числе кросс-задач с другими подразделениями и сотрудниками;</li>\r\n	<li>электронная почта;</li>\r\n	<li>система обмена короткими сообщениями (&quot;аська&quot;).</li>\r\n</ul>', '', '', '', '', '', 1, 1),
(7, 22, 'CRM GYDEX. Проекты под ключ', '<p><span itemprop="description">Вам нужно удачное сочетание CRM и ERP систем - <span class="gydex">&laquo;CRM GYDEX. Проекты под ключ&raquo;</span> предназначено именно для Вас. Не важно, где работает Ваша компания, она может быть в любой отрасли и с самым разнообразным спектром задач. Создается на платформе <span class="gydex">CRM GYDEX</span>. Идеально подходит для автоматизации компаний, которым, по разным причинам, не подходят &laquo;готовые&raquo; решения линейки <span class="gydex">CRM GYDEX</span>.</span></p>\r\n\r\n<p>В базовый функционал <span class="gydex">&laquo;CRM GYDEX. Проекты под ключ&raquo;</span> будут включены все возможности и блоки, которые необходимы именно Вам.</p>\r\n\r\n<p>Для нашей команды не существует ограничений для создания именно Вашей, уникальной <span class="gydex">CRM GYDEX</span>.</p>\r\n\r\n<p>Вы можете просмотреть массу предложений на рынке, от самых дорогих и раскрученных до простых и известных школьнику.</p>\r\n\r\n<p>Но только мы способны Вам предложить:</p>\r\n\r\n<ul>\r\n	<li>Бесплатный аудит Ваших бизнес-процессов;</li>\r\n	<li>Бесплатное составление технического задания;</li>\r\n	<li>Бесплатная разработка, внедрение Вашей индивидуальной версии <span class="gydex">CRM GYDEX</span>;</li>\r\n	<li>Бесплатная техническая поддержка Вашей индивидуальной версии <span class="gydex">CRM GYDEX</span>;</li>\r\n	<li>Бесплатное обучение Вашего персонала работе в Вашей индивидуальной версии <span class="gydex">CRM GYDEX</span>;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>И все это Вы получите при самой низкой цене на рынке облачных </strong><strong>CRM </strong><strong>и </strong><strong>ERP </strong><strong>систем! Убедитесь в этом сами, посчитав стоимость создания, разработки внедрения и обслуживания </strong><strong><span class="gydex">&laquo;CRM GYDEX. Проекты под ключ&raquo;</span> </strong><strong>с предложением любого конкурента!</strong></p>', '', '', '', '', '', 1, 1),
(8, 19, 'CRM GYDEX. Мобильный офис', '<p><span itemprop="description">Универсальная программа, яркая &laquo;смесь&raquo; CRM и ERP систем - <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> предназначено для автоматизации работы любых компаний, индивидуальных предпринимателей в любой отрасли и с самым разнообразным спектром задач. Интегрируется с любым программным продуктом линейки <span class="gydex">CRM GYDEX</span>. Идеально подходит для автоматизации всех участков компании &ndash; производства, склада, транспорта, офиса, удаленных подразделений, филиальной сети, группы дилеров или региональных представителей. Имеет очень широкий функционал в бухгалтерской и финансовой части, один из самых информационно емких продуктов линейки <span class="gydex">CRM GYDEX</span>.</span></p>\r\n\r\n<p>В базовый функционал <span class="gydex">&laquo;CRM GYDEX. Мобильный офис&raquo;</span> включены следующие возможности:</p>\r\n\r\n<ul>\r\n	<li>коммерческий блок &laquo;под ключ&raquo; (счета, реализации, поступления, оплаты и пр.);</li>\r\n	<li>система ведения контрагентов;</li>\r\n	<li>модуль создания прайс-листов, в т.ч. сложных товарных групп на русском и английском языках;</li>\r\n	<li>постановка и контроль выполнения плана продаж;</li>\r\n	<li>автоматическая выписка любого современного бухгалтерского и финансового документа;</li>\r\n	<li>контроль расчетных счетов компании, кассы, в т.ч. валютные сделки;</li>\r\n	<li>модуль постановки и контроля исполнения индивидуальных задач, в том числе кросс-задач с другими подразделениями и сотрудниками.</li>\r\n	<li>контроль исполнения бюджетов и анализ финансовых результатов;</li>\r\n	<li>электронный документооборот (бухгалтерский, управленческий, финансовый);</li>\r\n	<li>файловое хранилище данных;</li>\r\n	<li>широкий набор отчетов для всех видов бизнесов;</li>\r\n	<li>электронная почта;</li>\r\n	<li>система обмена короткими сообщениями (&quot;аська&quot;).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Решение&nbsp;</strong><span class="gydex">&laquo;CRM GYDEX. Мобильный бизнес&raquo;</span> <strong> прекрасно дорабатывается под задачи любого торгового или производственного предприятия, а также индивидуального предпринимателя</strong>. Программный продукт заменит Вам многие офисные и учетные программы, при несоизмеримо низкой стоимости работы.&nbsp;<strong>Все доработки традиционно бесплатны</strong>&nbsp;и включены в базовую стоимость использования программного продукта.</p>', '', '', '', '', '', 1, 1);
